import RPCert from "./certificate";
import RPTranscript from "../common/transcript";
import RPLCA from "./lca";

const templates = [
  {
    id: "certificate",
    label: "Certificate",
    template: RPCert
  },
  {
    id: "transcript",
    label: "Transcript",
    template: RPTranscript
  },
  {
    id: "competency",
    label: "Competency",
    template: RPLCA
  }
];

export default templates;
